In contrast, the testimony from Will Powers (Testimony 5), where he claims that he is sure the bellboy he saw must have been the assassin, suggests that he believes the assassin left the scene without being caught on camera or leaving any evidence behind. This is contradictory because if the camera was recording, it should have captured the assassin's actions before or during the murder, which contradicts Powers' certainty about the assassin being the bellboy.

